import React, { Component } from "react";
import { Row, Col, Card, Button, Icon, Progress,Table } from "antd";

import LineChart from "./LineChart";
import BarChart from "./BarChart";
import VerticalChart from "./VerticalChart";
import DonutChart from "./DonutChart";
import PieChart from "./PieChart";
import GroupBarChart from "./GroupBarChart";
import MixedChart from "./MixedChart";
import AreaChart from "./AreaChart";
const DataSet = require("@antv/data-set");



class OperationalAllCharts extends Component {
  constructor(props) {
    super(props);
    this.state = {
      chartData: [],
      selectedKey: "daily"
    };

  }
  render() {
    return (
      <div>
        <div id="content">
          <Row type="flex" gutter={24}>
            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:24, order: 5}} className="c-mb">
                  <LineChart />
            </Col>
          </Row>


          <Row type="flex" gutter={24}>
            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:24, order: 5}} className="c-mb">
                  <BarChart />
            </Col>
          </Row>

          <Row type="flex" gutter={24}>
            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:24, order: 5}} className="c-mb">
                  <VerticalChart />
            </Col>
          </Row>

          <Row type="flex" gutter={24}>
           <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:24, order: 5}} className="c-mb">
                  <GroupBarChart />
            </Col>

          </Row>


           <Row type="flex" gutter={24}>
            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:24, order: 5}} className="c-mb">
                  <PieChart />
            </Col>
          </Row>

           <Row type="flex" gutter={24}>

            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:24, order: 5}} className="c-mb">
                  <MixedChart />
            </Col>
          </Row>



           <Row type="flex" gutter={24}>
            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:24, order: 5}} className="c-mb">
                  <DonutChart />
            </Col>
          </Row>

          <Row type="flex" gutter={24}>
            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:24, order: 5}} className="c-mb">
                  <AreaChart />
            </Col>
          </Row>
          <Row type="flex" gutter={24}>
          </Row>


        </div>
      </div>
    );
  }
}
export default OperationalAllCharts;
